import React, { useState } from 'react';
import './Contact.css';

function Contact() {
  const [formData, setFormData] = useState({
    nome: '',
    email: '',
    telefone: '',
    condominio: '',
    mensagem: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // Criar o corpo do email
    const emailBody = `
Nome: ${formData.nome}
Email: ${formData.email}
Telefone: ${formData.telefone}
Condomínio: ${formData.condominio}
Mensagem: ${formData.mensagem}
    `;

    // Abrir cliente de email padrão
    const mailtoLink = `mailto:contato@pagedominus.com?subject=Contato pelo site - ${formData.nome}&body=${encodeURIComponent(emailBody)}`;
    window.location.href = mailtoLink;
    
    // Limpar formulário
    setFormData({
      nome: '',
      email: '',
      telefone: '',
      condominio: '',
      mensagem: ''
    });
  };

  return (
    <section className="contact-section">
      <div className="contact-container">
        <div className="contact-info">
          <h2>Entre em Contato</h2>
          <p>Transforme a gestão do seu condomínio com o PageDominus</p>
          
          <div className="info-item">
            <h3>📧 Email</h3>
            <p>contato@pagedominus.com</p>
          </div>
          
          <div className="info-item">
            <h3>📞 Telefone</h3>
            <p>(11) 99999-9999</p>
          </div>
          
          <div className="info-item">
            <h3>📍 Endereço</h3>
            <p>Rua Exemplo, 123<br />Centro, São Paulo/SP</p>
          </div>
          
          <div className="info-item">
            <h3>🕒 Horário de Atendimento</h3>
            <p>Segunda a Sexta: 9h às 18h<br />Sábado: 9h às 12h</p>
          </div>
        </div>
        
        <div className="contact-phone">
          <img src="/celular.png" alt="Aplicativo PageDominus no celular" className="phone-image" />
        </div>
      </div>
    </section>
  );
}

export default Contact;
